    ["Food", 400],
    ["Transportation", 250],
    ["Miscellaneous", 350],
    ["Rent", 800]
  ];

  export const options = {
    title: "My Daily Activities",
  };

const Userhome = () => {
    return (
        <div>
            This is the userhome page
            <Chart 
            chartType='PieChart'
            data={data}
            options={options}
            width={"100%"}
            height={"400%"}
            />
        </div>
    )
}

export default Userhome;
